It's a journey. You get out what you put in ?. I lost alot of muscle mass and weight during lockdown. I am now in the process of rebuilding. You will experience ups and downs. It's up to you to figure out what works and doesn't work for you. If it was easy we would all look like machines. Put in the effort and trust the process. Do not give up!!!

Thank you to the best trainers for all the support & knowledge. With out you I would never have accomplished so much ??

